	add("plenipotentiary", "{\"term\":\"plenipotentiary\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"First attested in 1645. From medieval Latin \u0027plenipotentiarius\u0027 from plenipotentia \u0027full powers\u0027, from \u0027plenipotens\u0027 from \u0027plēnus\u0027 (full) + \u0027potentia\u0027 (power)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person invested with full power, especially as the diplomatic agent of a sovereign state, (originally) charged with handling a certain matte\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1937\u0027\u0027, P. G. Wodehouse, \u0027Lord Emsworth and Others\u0027, Overlook, Woodstock: 2002, p 232\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Meeting him in the street and ignoring the foul bowler hat he wore on his walks abroad, you would have put him down as a Bishop in mufti or, at the least, a \u0027\u0027plenipotentiary\u0027\u0027 at one of the better courts\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, Anthony Burgess, \u0027Kingdom of the Wicked\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Two of them are hanging up there on Golgotha, and that ought to be enough to show the authority of Rome’s ah \u0027\u0027plenipotentiary\", \"priority\":5}]}, \"synonyms\":{}}");

