	add("plenum", "{\"term\":\"plenum\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027plēnum\u0027 noun use of neuter of \u0027plēnus\u0027 (full) Influenced by Russian \u0027пле́нум\u0027 (plenary session) from the same Latin source.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A space that is completely filled with matter\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1946\u0027\u0027, Bertrand Russell, \u0027A History of Western Philosophy\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The idea was that a thing could only move into an empty place, and that, in a \u0027\u0027plenum\u0027\u0027, there are no empty places\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Edward Grant, \u0027God and Reason in the Middle Ages\u0027, p. 176\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The key to understanding medieval interpretations of motion in hypothetically void space is to realize that medieval natural philosophers analyzed the same bodies in the void that they discussed in the \u0027\u0027plenum\u0027\u0027 of their ordinary world\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A state of fullness, a great quantity (of something\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1974\u0027\u0027, Guy Davenport \u0027Tatlin\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"He lay on the long stone slant down to the slapping waves, his denim shorts, sneakers, and socks under his head for a pillow, feeling the splendour of distance in all directions, the liquid silence, the \u0027\u0027plenum\u0027\u0027 of aloneness\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A legislative meeting (especially of the Communist Party) in which all members are present\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"An enclosed space having greater than atmospheric pressure\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The space above a false ceiling used for cables, ducts etc\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A type of network cabling which satisfies plenum-ratings issued by the National Electrical Code. These cables are safer in case of a fire, producing less smoke and fumes\", \"priority\":12}]}, \"synonyms\":{}}");

	add("pleonasm", "{\"term\":\"pleonasm\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"\u0027pleonasmus\u0027 from Ancient greek (to 1453) \u0027πλεονασμός\u0027 from \u0027πλεονάζω\u0027 (i am superfluous) from \u0027πλείων\u0027 (more)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Redundancy in wording\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, Anthony Burgess, \u0027A Dead Man in Deptford\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"My salvation is in my Saviour who saveth me hence the redundancy and \u0027\u0027pleonasm\u0027\u0027 of my asseveration\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Dec 14, 2007\u0027\u0027, Ryan North, \u0027Dinosaur Comics\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"pleonasm is the additional and extra use of added, spare, unnecessary, redundant (superfluous or surplus), unneeded, and uncalled-for words in addition to, and on top of, what is necessary or essential. Or required. Or obligatory or vital or requisite or crucial. Or needed\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A phrase involving pleonasm, that is, a phrase in which one or more words are redundant as their meaning is expressed elsewhere in the phrase\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"quot;The two of them are both the same\u0026quot; is a \u0027\u0027pleonasm\u0027\u0027 (as the word \u0026quot;both\u0026quot; is redundant), as is \u0026quot;killed dead\u0026quot\", \"priority\":7}]}, \"synonyms\":{}}");

	add("pleophony", "{\"term\":\"pleophony\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|pleo|phony|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The phenomenon by which the Late Proto-Slavic \u0026quot;liquid diphthongs\u0026quot;, formed from a vowel followed by a liquid *r or *l, become disyllabic -oro-, -ere- and -olo- reflexes in East Slavic languages\", \"priority\":1}]}, \"synonyms\":{}}");

